import { Component } from '@angular/core';
import { UserService } from '../user.service';
import { ActivatedRoute, Router } from '@angular/router';
import { Products } from '../products';

@Component({
  selector: 'app-create-product',
  templateUrl: './create-product.component.html',
  styleUrls: ['./create-product.component.css']
})
export class CreateProductComponent {
  id!:number;
  product:Products=new Products()

  constructor(private userService : UserService,private router:Router,
    private route:ActivatedRoute)
  {}

  ngOnInit(): void {  }

  saveProduct()
  {
    this.userService.createProduct(this.product).subscribe(data=>{console.log(data); this.goToProductList()},error=>console.log(error));
  }


  goToProductList()
  {
    this.router.navigate(['products']);
  }

  onSubmit()
  {
    console.log(this.product);
    this.saveProduct();
  }
}
<nav class="navbar navbar-expand-lg navbar-dark bg-info">
    <a class="navbar-brand" href="#"> <img class="imgicon" src="https://cdn-icons-png.flaticon.com/512/5470/5470044.png?ga=GA1.1.979865094.1697005373" ></a>
    <h1 class="text-center mr-auto">productslist</h1>
    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
  </nav>
<div class="col-md-3 offset-md-3 ">
<h1 class="text-center">create-product</h1>
<div>
    <form
        (ngSubmit)="onSubmit()">
        <div class="form-group">
            <input type="text" class="form-control" id="username" name="username" [(ngModel)]="product.productName"
             placeholder="Enter product name">
        </div>
        <div class="form-group">

            <input type="text" class="form-control" id="email" name="email" [(ngModel)]="product.product_price"
             placeholder="Enter product price">
        </div>
   <br/>
   <button type="submit " class="btn btn-success m-2">Submit</button>
</form>
</div>
</div>
